  `Friendly` binary(1) DEFAULT NULL,
  `Quiet` binary(1) DEFAULT NULL,
  `Height_inch` double DEFAULT NULL,
  `Weight_lb` double DEFAULT NULL,
  `Length_inch` varchar(7) DEFAULT NULL,
  `Coat_Color` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`Pet_ID`),
  KEY `User_ID` (`User_ID`),
